import Sidebar from '../src/Components/Side-bar/Side-bar.js'
import "bootstrap/dist/css/bootstrap.min.css";
import './index.css'
import AdminMenu from '../src/Components/Admin-menu/admin-menu.js'
import CreatorMenu from '../src/Components/Creator-menu/creator-menu.js'

import { BrowserRouter as Router } from 'react-router-dom';
import DonorMenu from './Components/Donor-menu/donor-menu.js';
function App() {
  return (
    <Router>
      <div className="App">
      <Sidebar><DonorMenu/></Sidebar>
    </div>
    </Router>

  );
}

export default App;
